script: |
  super -f text -I q3842.spq | sort > q3842.out

inputs:
  - name: q3842.spq
    data: |
      SELECT ALL ( - col2 ) AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT 39 BETWEEN - 64 * - 94 * col2 AND + col2 AND NOT ( NULL ) IS NULL;
  - name: tab1

outputs:
  - name: q3842.out
    data: |
